import React from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        width: '100%',
        height: '10px',
        overflowY: 'scroll',

    },
    container: {
        maxHeight: 230,
      },
});
const StyledTable = withStyles((theme) => ({
    root: {
        width: '95%',
        margin: 'auto',
        height: '100px',
        overflowY: 'scroll',
    },
}))(Table);

const StyledTableRow = withStyles((theme) => ({
    root: {
        backgroundColor: 'rgb(32,42,59)',

    },
}))(TableRow);

const StyledTabCell = withStyles((theme) => ({
    root: {
        borderColor: '#B6C512',
        color: 'white',

    },
    stickyHeader:{
        backgroundColor:'rgb(32,42,59)',
    }
}))(TableCell);

const StyledTybody = withStyles((theme) => ({
    root: {
        height: '10px',
        overflowY: 'hidden',

    },
}))(TableBody);



/*------------------------- Data---------------------------------------- */
function createData(Entreprise, Exposition, Secteur) {
    return { Entreprise, Exposition, Secteur };
}

const rows = [
    createData('RECKITT BENCKISER GROUP PLC', '3.37%', 'Activités des services financiers'),
    createData('AIR LIQUIDE', '3.34%', 'Industrie chimique'),
    createData('DNCA FINANCE LUXEMBOURG', '3.24%', 'DNCA FINANCE LUXEMBOURG'),
    createData('RECKITT BENCKISER GROUP PLC', '3.37%', 'Activités des services financiers'),
    createData('AIR LIQUIDE', '3.34%', 'Industrie chimique'),
    createData('DNCA FINANCE LUXEMBOURG', '3.24%', 'DNCA FINANCE LUXEMBOURG'),
    createData('AIR LIQUIDE', '3.34%', 'Industrie chimique'),
    createData('DNCA FINANCE LUXEMBOURG', '3.24%', 'DNCA FINANCE LUXEMBOURG'),
    createData('RECKITT BENCKISER GROUP PLC', '3.37%', 'Activités des services financiers'),
    createData('AIR LIQUIDE', '3.34%', 'Industrie chimique'),
    createData('DNCA FINANCE LUXEMBOURG', '3.24%', 'DNCA FINANCE LUXEMBOURG'),
    createData('RECKITT BENCKISER GROUP PLC', '3.37%', 'Activités des services financiers'),
];
/* ---------------------------------------------------------------------- */
export default function CountrepartieTable({data}) {
    const classes = useStyles();
    const [donnee, setData] = useState([]);
    
    useEffect(() => {
        setData(data);
        
    }, data, labels)
    return (
        <TableContainer className={classes.container}>
            <StyledTable stickyHeader  size="small"  aria-label="sticky table">
                <TableHead>
                    <StyledTableRow>
                        <StyledTabCell>Entreprise</StyledTabCell>
                        <StyledTabCell align="left">Exposition</StyledTabCell>
                        <StyledTabCell align="left">Secteur activité</StyledTabCell>
                    </StyledTableRow>
                </TableHead>
                <StyledTybody>
                    {donnee}?
                    {donnee.map((row) => (
                        <StyledTableRow key={row.name} >
                            <StyledTabCell component="th" scope="row">
                                {row.Entreprise}
                            </StyledTabCell>
                            <StyledTabCell align="left">{row.Exposition}</StyledTabCell>
                            <StyledTabCell align="left">{row.Secteur}</StyledTabCell>

                        </StyledTableRow>
                    ))} : ''
                </StyledTybody>
            </StyledTable>
        </TableContainer>
    );
}
